import psycopg2
from psycopg2 import sql

from constants import (
    db_user, db_pass
)


conn = psycopg2.connect(
    host="localhost",
    database="testing",
    user=db_user,
    password=db_pass,
)

# Create a cursor object
cur = conn.cursor()

cur.execute("CREATE EXTENSION IF NOT EXISTS postgis;")

# Enable Topology
cur.execute("CREATE EXTENSION IF NOT EXISTS postgis_topology;")

# Create a new table with a spatial column
cur.execute("""
    CREATE TABLE IF NOT EXISTS locations (
        id SERIAL PRIMARY KEY,
        name VARCHAR(255) UNIQUE,
        url VARCHAR(500) NOT NULL,
        importance double precision,
        tags text[], 
        geom GEOMETRY(Point, 4326)
    );
""")

# Define your SQL query
insert_query = sql.SQL(f"""
        INSERT INTO locations (name, url, importance, tags, geom) 
        VALUES (
            %s, 
            %s, 
            %s,
            %s::text[],
            ST_SetSRID(ST_MakePoint(%s, %s), 4326)
            )
        ON CONFLICT (name) DO NOTHING;
        """)

for record in data:
    name, url, imp, tags, long, lat = record
    c_tag = '{' + ','.join(map(str, tags)) + '}'
    try:
        # Execute the SQL command
        cur.execute(insert_query, (name, url, imp, c_tag, long, lat))

        # Commit your changes
        conn.commit()

        print("Data seeded successfully")

    except Exception as e:
        conn.rollback()
        print("Failed to seed data: ", str(e))

# Close the connection
cur.close()
conn.close()